import React from 'react';
import './Header.css';
const Header = () => {
  return (
    <header className='header'>
      <ul>
        <li>Shop</li>
        <li>About</li>
        <li>Contact</li>
        <li></li>
      </ul>
    </header>
  )
}

export default Header;
